ingredients_text:
Instant noodles (88%) {_wheat_ flour, palm oil, modified starch, salt, raising agents (sodium carbonates, potassium carbonates).}

Seasonings (12%) {flavour enhancers: E621, E635; salt, chicken extract powder (14%) (chicken extract (45%), maltodextrin, salt), flavouring, maltodextrin, sugar, garlic powder, _soy_ sauce powder (_soy_ beans, _wheat_, maltodextrin, salt), yeast extract, sesame seeds, chicken fat (1,8%), ginger powder, dried, chives, black pepper, caramelised sugar, acidity regulator: citric acid, colours: E100.}

Garnish (4,8%) {corn, carrot, leek.}

The product may contain traces of: _milk_, _egg_, _celery_, _mustard_, _crustaceans_, _molluscs_, _sulphur dioxide_ and _sulphites_.
